import React from 'react';
import { Button } from './Button';
import './HeroSection.css';
import '../App.css';
import { Slide } from 'react-slideshow-image'

const proprietes = {
    duration: 5000,
    transitionDuration: 500,
    infinite: true,
    indicators: true,
    arrows: true
}

const Slideshow = () => {
    return (
        <div className="containerSlide">
            <Slide {...proprietes}>
                <div className="each-slide">
                    <div>
                        <img src='images/pexels-andrea-piacquadio-3755707.jpg' alt="img1" />
                    </div>
                </div>
                <div className="each-slide">
                    <div>
                    <img src='images/pexels-ketut-subiyanto-4473777.jpg' alt="img2" />
                    </div>
                </div>
                <div className="each-slide">
                    <div>
                    <img src='images/pexels-lina-kivaka-1741231.jpg' alt="img3" />
                    </div>
                </div>
            </Slide>
        </div>
    )
}

export default HeroSection;
